import './Navigation.css';

function Navigation(props) {
  return (
    <section className={`navigation ${props.isActiveMovies}`}>
      <a className='navigation__link' href='/movies'>
        Фильмы
      </a>
      <a className={`navigation ${props.isActiveSavedMovies}`} href='/saved-movies'>
        Сохранённые фильмы
      </a>
    </section>
  );
}

export default Navigation;
